import React from 'react';
import Title from '../../features/title/Title';
import { isCatalogueTitle } from '../../data/TitleData';
import TopVerticalBar from '../../features/post/TopVerticalBar';
import { isCatalogueData } from '../../data/CatalogueData';
import Footer from '../../features/footer/Footer';
import { FooterData } from '../../data/FooterData';
import TopMessage from './TopMessage';
import CatalogHeader from './CatalogHeader';
import CatalogCat from './CatalogCat';
import { isCatalogCatData } from '../../data/CatalogCatData';
import PackPromo from './PackPromo';
import { isPackPromoData } from '../../data/packPromoData';

const Catalogue = () =>{

    return(
        <>
        <Title {...isCatalogueTitle}/>
        <TopVerticalBar/>
        <TopMessage {...isCatalogueData}/>
        <CatalogHeader {...isCatalogueData}/>
        <CatalogCat {...isCatalogCatData}/>
        <PackPromo {...isPackPromoData}/>
        <Footer footerData={FooterData}/>
        </>
    )
}

export default Catalogue;
